import React from 'react'
import Link from 'next/link'
import { useRouter } from 'next/router'

export default function Detail() {
  const router = useRouter()

  return (
    <div>
      <p>{router.query.id}</p>
      <Link href="/">
        <a>Index Page</a>
      </Link>
    </div>
  )
}
